import React from 'react';
import PropTypes from 'prop-types';
import { Link } from "react-router-dom";


const navMainCont = {
    backgroundColor: "black",
    padding: "1rem 3rem",
    paddingRight: "2rem",
    color: "#979494",
    display: "flex",
    justifyContent: "space-between"
}

const navList = {
    display: "flex"

}

const navListItem = {
    marginRight: "0.9em",
    marginTop: "1em",
    padding: "0.2rem",
    textAlign: 'center',
    fontWeight: "bold",
    // border: "1px white solid"

}



const navIcon = {
    marginRight: "0.5em",
    padding: "1rem",
    // border: "1px white solid",
    color: "#02FFFF",
    fontStyle: "italic",
    fontWeight: "900"
}


const NavBar = () => {
    return (
        <nav className="navBarMainContainer">
            <div className="navBarLogoContainer">
                <h2 className="navBarLogo">DT</h2>
            </div>
            <div className="navBarNavigation">
                <Link id="link" to="/"><h4 className="navBarLinkItem">Home</h4></Link>
                <Link id="link" to="/about"><h4 className="navBarLinkItem">About</h4></Link>
                <Link id="link" to="/projects"><h4 className="navBarLinkItem">Projects</h4></Link>
            </div>
        </nav>

    )
}


export default NavBar;
